let playerID=5466734,apiKey="EXAMPLE_API_KEY";const apiUrl=`"https://api.brawlhalla.com/player/${playerID}/stats?api_key=${apiKey}`,playerData="./public/js/player.json";let legendsData=[];fetch(playerData).then(response=>response.json()).then(data=>{let legendsData=data.legends;for(let i=0;i<legendsData.length;i++){let legends=legendsData[i],legendNameData,legendName=legends.legend_name_key.replace(/\s+/g,""),legendLevel=legends.level,legendLocation=document.getElementById(`${legendName}`);legendLocation.innerHTML=legendLevel>=25?`\n                <img class="container-character__icon" src="./public/img/legends/Portrait_${legendName}.webp" alt="${legendName} frame">\n                <div class="container-character__checkmark">\n                    <i class="fa-solid fa-circle-check"></i>\n                </div>\n                <div class="container-character__level">\n                    <h2 style="color: rgb(125, 255, 125)">${legendLevel}</h2>\n                </div>\n                `:`\n                    <img class="container-character__icon-none" src="./public/img/legends/Portrait_${legendName}.webp" alt="${legendName} frame">\n                    <div class="container-character__checkmark-none">\n                        <i class="fa-solid fa-circle-xmark"></i>\n                    </div>\n                    <div class="container-character__level">\n                        <h2 style="color: crimson">${legendLevel}</h2>\n                    </div>\n                    `}}).catch(error=>{console.log(error)});